import { React, useEffect } from "react";
import { generateStars } from "../utils/homePage";
import "../styles/HomePage.css";

function HomePage() {
    useEffect(() => {
        generateStars();
		galaxy();
    })

	return (
		<div>
			<div className="stars"></div>
			<div className="view">
				<div className="plane main">
					<div className="circle"></div>
					<div className="circle"></div>
					<div className="circle"></div>
					<div className="circle"></div>
					<div className="circle"></div>
					<div className="circle"></div>
				</div>
			</div>
		</div>
	);
}

export default HomePage;
